import { useEffect, useState } from "react"

function App() {
    const [products, setProducts] = useState([]);
    const fetchData = () => {
        fetch('https://dummyjson.com/products').then( response => { return response.json()}
        ).then(data => {setProducts(data)})
        console.log(data)
    }

    useEffect(()=> {fetchData()},[])
    

    return (
        <div>
            {products && products.length > 0 && ( <ul>
                {products.map(product => (
                    <button onClick={fetchData} key={product.id}>GET</button>
                ))}
            </ul>)}
           
        </div>
    )
}
export default App;
